import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Container, Form, Row } from "react-bootstrap";
import "../css/footer.css";

const Footer = () => {
  return (
    <>
      <Container>
        <Row>
          <h1>hello world</h1>
        </Row>
      </Container>
    </>
  );
};

export default Footer;
